import React from "react"
import Profile from "./Profile"
import Card from "./Card"
import data from "./../data.json"

export default function Dashboard() {
    const cards = data.map(card => {
        return <Card
            key={card.id} 
            card={card}
        />
    })

    return (
        <div className="dashboard">
            <Profile />
            { cards }
        </div>
    )
}
